import React from 'react';
import {CardList} from './components/card-list/card-list.component'
import './App.css';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      projects: [
        {
          name: 'Corona Test',
          id: 'pr1'
        },
        {
          name: 'Simple Weather',
          id: 'pr2'
        },
        {
          name: 'Router Library',
          id: 'pr3'
        },
        {
          name: 'Flappy Bird',
          id: 'pr4'
        },
        {
          name: 'ToDo pwa',
          id: 'pr5'
        },
        {
          name: 'Portfolio',
          id: 'pr6'
        },
        {
          name: 'Hangman',
          id: 'pr7'
        }
      ]
    };
  }
  render(){
    return (
      <div className="App">
        <CardList>
          {this.state.projects.map(project => (
            <h1 key={project.id}> {project.name} </h1>
          ))}
        </CardList>
      </div>
    );
  }
}

export default App;
